import React, { Component } from 'react';
import logo from './logo.svg';
import './swipe.css';

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "Berkeley Social Club",
      location: "2050 University Ave",
      rating: 4,
      food: "Breakfast Food",
      price: "$$",
      picture: "img.png",
      liked: false
    };
  }

  upateData() {

  }

  render () {
    return (
      <div class="card">
            <h2 class="name">{this.state.name}</h2>
            <p class="type-cost">{this.state.food} | {this.state.price}</p>
            <p class="address">{this.state.location}</p>
            <div class="stars">{this.state.rating}</div>
            <img src="assets/img/no.png"/>
            <img src="assets/img/yes.png"/>
      </div>
    );
  }

}

export default Card;
